// client/src/pages/Register.jsx
import React, { useState, useEffect } from "react";
import "particles.js";
import axios from "axios";

const Register = () => {
  const [form, setForm] = useState({ name: "", email: "", password: "" });

  useEffect(() => {
    window.particlesJS("particles-js", {
      particles: {
        number: { value: 80, density: { enable: true, value_area: 800 } },
        color: { value: "#00ffff" },
        shape: { type: "circle" },
        opacity: { value: 0.5 },
        size: { value: 3 },
        line_linked: { enable: true, color: "#00ffff", opacity: 0.4 },
        move: { enable: true, speed: 2 },
      },
      interactivity: {
        events: {
          onhover: { enable: true, mode: "repulse" },
          onclick: { enable: true, mode: "push" },
        },
      },
      retina_detect: true,
    });
  }, []);

  const handleChange = (e) => {
    setForm({ ...form, [e.target.name]: e.target.value });
  };

  const handleRegister = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post(
        "https://api-fable-forest.onrender.com/api/auth/register",
        form
      );
      localStorage.setItem("token", res.data.token);
      alert("Registration successful!");
      window.location.href = "/user";
    } catch (err) {
      alert(err.response?.data?.message || "Registration failed. Try again.");
    }
  };

  return (
    <div style={{
      position: "relative",
      width: "100vw",
      height: "100vh",
      overflow: "hidden",
      backgroundColor: "#000",
      fontFamily: "'Orbitron', sans-serif",
      display: "flex",
      alignItems: "center",
      justifyContent: "center"
    }}>
      <div id="particles-js" style={{
        position: "absolute",
        width: "100%",
        height: "100%",
        zIndex: 0
      }}></div>

      <div style={{
        position: "relative",
        zIndex: 1,
        width: "100%",
        maxWidth: "300px",
        padding: "20px",
        borderRadius: "10px",
        border: "2px solid #00ffff",
        backgroundColor: "rgba(0, 0, 0, 0.5)",
        boxShadow: "0 0 15px #00ffff",
        textAlign: "center",
        color: "#fff",
        backdropFilter: "blur(4px)"
      }}>
        <h2 style={{
          fontSize: "22px",
          color: "#00ffff",
          marginBottom: "6px",
          textShadow: "0 0 6px #00ffff"
        }}>REGISTER</h2>
        <form onSubmit={handleRegister}>
          {["name", "email", "password"].map((field, i) => (
            <div key={field} style={{ marginBottom: "12px", textAlign: "left" }}>
              <label style={{
                display: "block",
                marginBottom: "4px",
                fontSize: "12px",
                color: "#ccc"
              }}>{field === "name" ? "Full Name" : field === "email" ? "Email Address" : "Password"}</label>
              <input
                type={field === "password" ? "password" : "text"}
                name={field}
                value={form[field]}
                onChange={handleChange}
                required
                style={{
                  width: "100%",
                  padding: "6px 10px",
                  fontSize: "12px",
                  backgroundColor: "transparent",
                  border: "1px solid #00ffff",
                  borderRadius: "6px",
                  color: "#fff",
                  outline: "none",
                  boxShadow: "0 0 6px #00ffff"
                }}
              />
            </div>
          ))}
          <button type="submit" style={{
            width: "100%",
            padding: "8px",
            fontSize: "13px",
            backgroundColor: "transparent",
            border: "1px solid #00ffff",
            color: "#00ffff",
            borderRadius: "6px",
            cursor: "pointer",
            boxShadow: "0 0 8px #00ffff"
          }}>Sign Up</button>
          <p style={{ marginTop: "10px", fontSize: "12px", color: "#ccc" }}>
            Already have an account? <a href="/login" style={{
              color: "#ff00ff",
              textDecoration: "none",
              fontWeight: "bold",
              textShadow: "0 0 5px #ff00ff"
            }}>Login here</a>
          </p>
        </form>
      </div>
    </div>
  );
};

export default Register;
